const Home = () => {
    return ( 
        <body>
            <section className="myHeader all_section">
                <div></div>
            </section>
            <section className="myLogo all_section">Logo</section>
            <section className="myCategory all_section">Category</section>
            <section className="myUpperSection all_section">Upper Section</section>
            <section className="myLowerSection all_section">
                <div className="myLeft all_lowerSection">Left</div>
                <div className="myRight all_lowerSection">Right</div>
            </section>
            <section className="myFooter all_section">Footer</section>
        </body>
     );
}

export default Home;
